import {
  StyledProjects,
  ProjectsContainer,
  SingleProjectCont,
  DemoBLock,
} from "./styles/Projects.styled";
import pokeImg from "../assets/pokeImg.png";
import { data } from "../utils/DataProjects";

const Projects = () => {
  return (
    <StyledProjects>
      <div>
        <h1>Projects.</h1>
      </div>
      <ProjectsContainer>
        //Pokemon APP Block
        <SingleProjectCont className="pokeContainer">
          <img src={pokeImg} alt="" />
          <h1>{data.pokeApp.title}</h1>
          <h3>{data.pokeApp.description}</h3>
          <DemoBLock>
            <div>
              <p>Github</p>
            </div>
            <div>
              <p>Live Demo</p>
            </div>
          </DemoBLock>
        </SingleProjectCont>
        //Movie APP Block
        <SingleProjectCont className="movieContainer"></SingleProjectCont>
        <div className="amazonContainer"></div>
        <div className="gameContainer"></div>
      </ProjectsContainer>
    </StyledProjects>
  );
};

export default Projects;
